description:
Elizabeth I War on Terror

History Documentary hosted by Mark Bazeley, published by National Geographic in 2014 - English narration


Information
------------------------------

Elizabeth I War On Terror
Summer 1586 is England's darkest hour. A terrorist cell of Catholic extremists is planning to kill Elizabeth and install the Queen of Scots on her throne. One man stands in the way: Sir Francis Walsingham, Elizabeth's spymaster and security chief. So why was this dangerous prince of spies so dedicated to his Queen and country? In this tense documentary we'll explore new visual evidence that will transform our understanding of Walsingham's dark world.

